package com.boco.eoms.deviceManagement.baseInfo.model;

public class AdvertisementPlan {
	
	private String id;
	private String createUserId;
	private String createTime;
	private String reviewer;
	private String city;
	private String status;
	private String generalStone;
	private String detectStone;
	private String advertisement;
	private String remarks;

	public AdvertisementPlan() {
		// TODO Auto-generated constructor stub
	}

	public String getId() {
		return id;
	}

	public void setId(String id) {
		this.id = id;
	}

	public String getCreateUserId() {
		return createUserId;
	}

	public void setCreateUserId(String createUserId) {
		this.createUserId = createUserId;
	}

	public String getCreateTime() {
		return createTime;
	}

	public void setCreateTime(String createTime) {
		this.createTime = createTime;
	}

	

	public String getReviewer() {
		return reviewer;
	}

	public void setReviewer(String reviewer) {
		this.reviewer = reviewer;
	}

	public String getCity() {
		return city;
	}

	public void setCity(String city) {
		this.city = city;
	}

	

	public String getGeneralStone() {
		return generalStone;
	}

	public void setGeneralStone(String generalStone) {
		this.generalStone = generalStone;
	}

	public String getDetectStone() {
		return detectStone;
	}

	public void setDetectStone(String detectStone) {
		this.detectStone = detectStone;
	}

	public String getAdvertisement() {
		return advertisement;
	}

	public void setAdvertisement(String advertisement) {
		this.advertisement = advertisement;
	}

	public void setRemarks(String remarks) {
		this.remarks = remarks;
	}

	public String getRemarks() {
		return remarks;
	}

	public void setStatus(String status) {
		this.status = status;
	}

	public String getStatus() {
		return status;
	}
	

}
